import React from 'react'
import ReactDOM from 'react-dom'
const Header = (props) => {
    return (
        <div>
            <p> {props.course} </p>
        </div>
    )
}
const Content = (props) => {
    return (
        <div>
            <p>{props.part1} {props.excersises1}</p>
            <p>{props.part2} {props.excersises2}</p>
            <p>{props.part3} {props.excersises3}</p>
        </div>
    )
}
const App = () => {
  const course = 'Half Stack -sovelluskehitys'
  const part1 = 'Reactin perusteet'
  const exercises1 = 10
  const part2 = 'Tiedonvälitys propseilla'
  const exercises2 = 7
  const part3 = 'Komponenttien tila'
  const exercises3 = 14

  return (
    <div>
        <Header course = {course} />
        <Content>
            part1 = {part1} part2 = {part2} part3 = {part3}
            excersises1 = {exercises1} excersises2 = {exercises2} excersises3 = {exercises3}
        </Content>
      <p>yhteensä {exercises1 + exercises2 + exercises3} tehtävää</p>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
